import React, { useEffect, useState } from 'react'
import Header from "../components/Header";
import Footer from '../components/Footer';
import { Formik, Form, Field, FieldArray, ErrorMessage } from 'formik';
import * as yup from 'yup';
import axios from 'axios';
import { Await, Link, useNavigate } from 'react-router-dom';


const Pricing = () => {
    const navigate = useNavigate();
    const [username, setUsername] = useState([]);
    const [price, setPrice] = useState([]);
    useEffect(() => {

        const axiosConfig = {
            headers: {
                'Accept': 'application/json',
                Authorization: 'Bearer ' + localStorage.getItem("token"),
            }
        }
        axios
            .get('https://rsacarbook.jaraware.com/api/v1/getUserData', axiosConfig)
            .then((res) => {
                setUsername(res.data.data.user.first_name);
            })
            .catch((err) => {
                console.log(err);
            });
    }, []);

    useEffect(() => {

        const axiosConfig = {
            headers: {
                'Accept': 'application/json',
                Authorization: 'Bearer ' + localStorage.getItem("token"),
            }
        }
        axios
            .get('https://rsacarbook.jaraware.com/api/v1/getPlanList', axiosConfig)
            .then((res) => {
                console.log("res", res.data);
                setPrice(res.data.data.plan);
            })
            .catch((err) => {
                console.log(err);
            });
    }, []);

    const removeToken = (userToken) => { // export function from module 
        localStorage.removeItem("token");
        navigate("/");
        // setToken(null);
    }

    return (
        <>
            <header className='dash-header'>
                <div className='app-logo'>
                    <h1><Link to="/dashboard">Prakash</Link></h1>
                </div>
                <div className='app-right'>
                    <p>Hello,  <span className='white-color'>{username}</span>
                        <button className="custom-btn" onClick={removeToken}>Log Out</button>
                    </p>
                </div>
            </header>
            <section className='signup-page dashboard'>
                <div className='d-flex'>
                    <div className='sign-left'>
                        <ul className='user-pages'>
                            <li><Link className='custom-btn' to='/updateprofile'>Update Your Profile</Link> </li>
                            <li><Link className='custom-btn' to='/uplaodDocument'>Upload Your Documents</Link> </li>
                            <li><Link className='custom-btn' to='/inquery'>Inquery</Link> </li>
                            <li><Link className='custom-btn' to='/pricing'>Pricing</Link> </li>
                            <li><button className="custom-btn" onClick={removeToken}>Log Out</button></li>
                        </ul>
                    </div>
                    <div className='sign-right'>
                        <div className='main-form'>
                            <h2>Pricing :</h2>
                            <div className="pricing-plan">
                                {
                                    price.map((val, i) => (
                                        <div className='item' key={i}>
                                            <h5>planname: {val.planname}</h5>
                                            <h5>Price: {val.price}</h5>
                                            <h6>Duration: {val.duration}</h6>
                                            <p>Description: {val.description}</p>
                                        </div>
                                    ))
                                }
                            </div>
                        </div>
                    </div>
                </div>
                <Footer />

            </section>
        </>
    )
}

export default Pricing;
